import React, { useState, useEffect } from "react";
import "./App.css";

function FinancialData() {
  const [data, setData] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [sortBy, setSortBy] = useState('revenue');
  const [order, setOrder] = useState('asc');

  // Filter states
  const [filterBy, setFilterBy] = useState('');
  const [filterValueMin, setFilterValueMin] = useState('');
  const [filterValueMax, setFilterValueMax] = useState('');

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await fetch(
          `http://localhost:5000/api/data?sort_by=${sortBy}&order=${order}&filter_by=${filterBy}&filter_value_min=${filterValueMin}&filter_value_max=${filterValueMax}`
        );
        const result = await response.json();
        console.log("Fetched data:", result);
        setData(result);
      } catch (error) {
        setError(error);
      } finally {
        setLoading(false);
      }
    };

    fetchData();
  }, [sortBy, order, filterBy, filterValueMin, filterValueMax]); // Triggered when filter or sort changes

  const handleSort = (column) => {
    if (sortBy === column) {
      setOrder(order === 'asc' ? 'desc' : 'asc');
    } else {
      setSortBy(column);
      setOrder('asc');
    }
  };

  const handleFilterSubmit = (e) => {
    e.preventDefault();
    if (
      (filterValueMin && isNaN(filterValueMin)) || 
      (filterValueMax && isNaN(filterValueMax)) ||
      (filterValueMin && filterValueMax && parseFloat(filterValueMin) > parseFloat(filterValueMax))
    ) {
      setError("Invalid filter values. Please check the range inputs.");
      return;
    }

    setLoading(true);
  };

  if (loading) {
    return <div className="loading">Loading...</div>;
  }

  if (error) {
    return <div className="error">{error}</div>;
  }

  return (
    <div className="p-6 bg-gray-50 min-h-screen">
      <h1 className="text-3xl font-bold text-gray-800 text-center mb-8">Annual Financial Data for Apple</h1>

      {/* Filter Form */}
      <form onSubmit={handleFilterSubmit} className="mb-8">
        <div className="flex space-x-4">
          <div>
            <label className="block text-sm font-medium">Filter by</label>
            <select
              value={filterBy}
              onChange={(e) => setFilterBy(e.target.value)}
              className="px-4 py-2 border border-gray-300 rounded"
            >
              <option value="">Select filter</option>
              <option value="date">Year</option>
              <option value="revenue">Revenue</option>
              <option value="netIncome">Net Income</option>
            </select>
          </div>

          <div>
            <label className="block text-sm font-medium">Min</label>
            <input
              type="number"
              value={filterValueMin}
              onChange={(e) => setFilterValueMin(e.target.value)}
              className="px-4 py-2 border border-gray-300 rounded"
            />
          </div>

          <div>
            <label className="block text-sm font-medium">Max</label>
            <input
              type="number"
              value={filterValueMax}
              onChange={(e) => setFilterValueMax(e.target.value)}
              className="px-4 py-2 border border-gray-300 rounded"
            />
          </div>

          <button
            type="submit"
            className="px-4 py-2 bg-blue-500 text-white rounded"
          >
            Apply Filter
          </button>
        </div>
      </form>

      {/* Table */}
      <table className="table-auto w-full border border-gray-200 shadow-lg">
        <thead className="bg-gray-100">
          <tr>
            <th onClick={() => handleSort('date')} className="px-4 py-2 border border-gray-700">Date</th>
            <th onClick={() => handleSort('revenue')} className="px-4 py-2 border border-gray-700">Revenue</th>
            <th onClick={() => handleSort('netIncome')} className="px-4 py-2 border border-gray-700">Net Income</th>
            <th onClick={() => handleSort('grossProfit')} className="px-4 py-2 border border-gray-700">Gross Profit</th>
            <th onClick={() => handleSort('eps')} className="px-4 py-2 border border-gray-700">EPS (Earnings Per Share)</th>
            <th onClick={() => handleSort('operatingIncome')} className="px-4 py-2 border border-gray-700">Operating Income</th>
          </tr>
        </thead>
        <tbody>
          {data.map((item, index) => (
            <tr key={index} className="odd:bg-white even:bg-gray-50 hover:bg-gray-100">
              <td className="px-4 py-2 border border-gray-700">{item.date}</td>
              <td className="px-4 py-2 border border-gray-700">{item.revenue}</td>
              <td className="px-4 py-2 border border-gray-700">{item.netIncome}</td>
              <td className="px-4 py-2 border border-gray-700">{item.grossProfit}</td>
              <td className="px-4 py-2 border border-gray-700">{item.eps}</td>
              <td className="px-4 py-2 border border-gray-700">{item.operatingIncome}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default FinancialData;
